class event_listen{constructor(){this.form=document.querySelectorAll(".form"),this.form_1_sumbit=document.getElementById("submit-step1")}all_forms(){for(let e=0;e<this.form.length;e++)this.form[e].addEventListener("submit",e=>{e.preventDefault();const t=e.target.id;if(console.log(t),"form"==t.split("-")[0])try{document.getElementById(`main-tab-${t.charAt(t.length-1)}`).click()}catch(e){console.log("No such page here.")}else console.log(t.split("-")[0])})}}(function(){const e=new event_listen;e.all_forms(),console.log("Successfully imported and updated"),document.getElementById("btn-start").addEventListener("click",e=>{document.getElementById("main-tab-1").click(),console.log("Success")})})();